export default function Todo(props) {
    return (
                <div className="todo-item"> 
                <div className="todo-outer-circle" >
                  <div className={props.completed ? "todo-circle-ticked" : "todo-inner-circle"}>
                  </div>
                </div>
                <div style={{ textDecoration: props.completed ? "line-through" : "" }} className="todo-text">
                  {props.text}</div>
                <button className="todo-delete"></button>
              </div>

    );
}
